-- Table structure for t_order
-- ----------------------------
DROP TABLE IF EXISTS `t_order`;
CREATE TABLE `t_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `num` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单号共18位，生成规则前缀加数字，1位:前缀C，2位交易类型，3-10位年月日,11-18位，交易序列号，例如C12015051800000009',
  `parentNum` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT '主订单号',
  `payNum` bigint(20) DEFAULT NULL COMMENT '支付服务商生成的订单号',
  `oname` bigint(20) DEFAULT NULL COMMENT '订单名称',
  `shopId` bigint(20) DEFAULT NULL COMMENT '店铺ID',
  `productId` text COLLATE utf8_unicode_ci COMMENT '商品ID',
  `otype` int(20) DEFAULT NULL COMMENT '交易类型1：未知分类，2：购买商品支付，3:：会员充值，4：物业费，5：快递邮费，6：充话费',
  `payType` bigint(20) DEFAULT NULL COMMENT '支付类型1：支付宝，2：微信，3:银行卡，4：现金支付',
  `orderAmount` float DEFAULT NULL COMMENT '订单应该支付金额',
  `payAmount` float DEFAULT NULL COMMENT '实际支付金额',
  `productCount` int(11) DEFAULT NULL COMMENT '包含商品数',
  `fromMemberId` bigint(20) DEFAULT NULL COMMENT '付款人',
  `toMemberId` bigint(20) DEFAULT NULL COMMENT '收款人',
  `process` int(11) DEFAULT NULL COMMENT '订单状态1：已下单未付款，2：已付款待确认，3：已确认待送货，4：正在送货待收货，5：已收货，完成交易',
  `addrId` bigint(20) DEFAULT NULL COMMENT '收货地址',
  `cityPath` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '所在城市',
  `addrDetail` text COLLATE utf8_unicode_ci COMMENT '收货地址详细说明',
  `estimatTime` bigint(20) DEFAULT NULL COMMENT '预计送达时间',
  `finishTime` bigint(20) DEFAULT NULL COMMENT '实际完成时间',
  `remark` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注信息',
  `invoiceNum` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发票号码',
  `sellerTel` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `sellerName` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customTel` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customName` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createTime` bigint(20) DEFAULT NULL COMMENT '交易时间',
  `state` int(11) DEFAULT NULL COMMENT '订单状态1：可用，0：禁用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=143 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='订单表';

-- ----------------------------
-- Records of t_order
-- ----------------------------

